import React from 'react';
import useLeafletMap from '../../../';

const Map = ({ center, zoom, height, width, text }) => {
    const markers = [
        {
            position: center,
            popup: text || ''
        }
    ];

    const LeafletMap = useLeafletMap(center, zoom, height, width, markers);

    return (
        <>
            {LeafletMap}
        </>
    );
}

export default Map;
